fields.description:
The order of rules is unimportant, as they are always sorted before being evaluated.

Example of valid rules:

```json
[
  {
    "action" : {
      "groupId" : "76ca8bff-7e7a-4379-aecf-93ac1c3cf617",
      "type" : "MoveToGroup"
    },
    "type" : "Joins"
  },
  {
    "ageInMonths" : 48,
    "month" : "SEPTEMBER",
    "action" : {
      "ageGroupId" : "d924ece9-d60f-41ed-bc2a-36becb95b517",
      "type" : "MoveToAgeGroup"
    },
    "conditions" : [
      {
        "ageGroupId" : "1b908fc9-d136-441e-9cf1-e4ffbe2834cb",
        "type" : "InAgeGroup"
      }
    ],
    "type" : "MonthAfterAge"
  },
  {
    "ageInMonths" : 120,
    "when" : "FirstOfNextMonth",
    "action" : {
      "type" : "Leave"
    },
    "conditions" : [
    ],
    "type" : "Age"
  },
  {
    "conditions" : [
      {
        "ageGroupId" : "d924ece9-d60f-41ed-bc2a-36becb95b517",
        "type" : "InAgeGroup"
      }
    ],
    "action" : {
      "groupId" : "abc144e2-47ba-4fe8-bd22-e2d6e98fb553",
      "type" : "MoveToGroup"
    },
    "type" : "If"
  }
]
```
